import React, { Component } from 'react'
import LinkedInLogin from './LinkedInLogin'

export class Landing extends Component {
  render() {
    return (
      <div>
        <p>Hello from Landing</p>
        <LinkedInLogin />
      </div>
    )
  }
}

export default Landing
